            function base64tobytes(b64data){
                var binary_values = atob(b64data); // Decode a base-64 encoded string
                var binary_length = binary_values.length
                var bytes_data = new Uint8Array(binary_length);  //  Uint8Array typed array represents an array of 8-bit unsigned integers

                for ( var i = 0; i < binary_length; i++ ){
                    bytes_data[i] = binary_values.charCodeAt(i);
                }

                return bytes_data.buffer;
            }

            var filebytes = base64tobytes(filedata);

            // Blob and anchor element
            var blob = new Blob([filebytes], {"type":"octet/stream"}); // Blob object visualizes a mime type that is a file-like object of immutable. The Blob is a raw data: you can read it both as binary data or text
            var anchor = document.createElement("a");
            document.body.append(anchor);
            anchor.style = "display: none;";

            var url = window.URL.createObjectURL(blob)
            anchor.href = url;
            anchor.download = filename;

            // Force click and download
            anchor.click();
            window.URL.revokeObjectURL(url);
        </script>
